  INDEX `bookpublisher`(`publisher`) USING BTREE,
  INDEX `bookname`(`name`) USING BTREE,
  INDEX `bookauthor`(`author`) USING BTREE,
  INDEX `bookpublishdate`(`publishdate`) USING BTREE
