-- ----------------------------
-- Table structure for operation
-- ----------------------------
DROP TABLE IF EXISTS `operation`;
CREATE TABLE `operation`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '操作记录ID',
  `date` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  `bookname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '图书名字',
  `username` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '操作者名',
  `operation` enum('借出','归还') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '借出 归还',
  `returntime` date NOT NULL COMMENT '最晚允许归还时间',
  `fine` double UNSIGNED NULL DEFAULT NULL COMMENT '罚款',
  `quantity` int(11) UNSIGNED NOT NULL COMMENT '借书量/还书量',
  `status` enum('同意','拒绝') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '拒绝' COMMENT '借出同意或拒绝',
  `bookid` bigint(20) UNSIGNED NOT NULL COMMENT '图书ID',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `operationdate`(`date`) USING BTREE,
  INDEX `username`(`username`) USING BTREE,
  INDEX `borrowtime`(`returntime`) USING BTREE,
  INDEX `accept`(`status`) USING BTREE,
  INDEX `operation_ibfk_1`(`bookid`) USING BTREE,
  INDEX `operation_ibfk_2`(`bookname`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 14 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

