-- ----------------------------
-- Triggers structure for table operation
-- ----------------------------
DROP TRIGGER IF EXISTS `Checkborrowtime1`;
delimiter ;;
CREATE TRIGGER `Checkborrowtime1` BEFORE INSERT ON `operation` FOR EACH ROW BEGIN 
IF(new.returntime < new.date AND new.operation = '借出') THEN SIGNAL SQLSTATE '48000' SET MESSAGE_TEXT ="借出时间不得小于操作时间!";
END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table operation
-- ----------------------------
DROP TRIGGER IF EXISTS `addfine`;
delimiter ;;
CREATE TRIGGER `addfine` BEFORE INSERT ON `operation` FOR EACH ROW BEGIN
IF(new.date>new.returntime)
THEN SET new.fine = 5*new.quantity;
END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table operation
-- ----------------------------
DROP TRIGGER IF EXISTS `Checkfine`;
delimiter ;;
CREATE TRIGGER `Checkfine` BEFORE UPDATE ON `operation` FOR EACH ROW BEGIN 
IF(new.returntime < new.date AND new.operation = '归还' AND new.fine = 0 AND new.status = '同意') THEN SIGNAL SQLSTATE '48000' SET MESSAGE_TEXT ="超出归还时间，罚款不得为0！";
END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table operation
-- ----------------------------
DROP TRIGGER IF EXISTS `stockreturn`;
delimiter ;;
CREATE TRIGGER `stockreturn` BEFORE UPDATE ON `operation` FOR EACH ROW BEGIN
IF(new.status = '同意' AND old.status = '拒绝')THEN
IF(new.operation = '借出')THEN
 UPDATE book SET stock = stock - new.quantity WHERE id=new.bookid;
 ELSEIF (new.operation = '归还')THEN
 UPDATE book SET stock = stock + new.quantity WHERE id=new.bookid;
 END IF;
 END IF;
END
;;
delimiter ;

